Aniquely evloved blend of strength and cardio intervals makes this a fun yet powerful work-out for the entire body. Starting with dynamic warm up that gently prepares you for the work to come, this energetic Work-out is suitable for all levels. It highlights the values of core conditioning, functional strength, and fast paced cardio intervals. Bringing play back into your work-outs, can be exhilarating work. Push your limits, as Lara sets a brisk pace to bring you total health. A work-out designed for all ages with large doses of fun and play.
